export default function SubHeader(props) {
    // const style = {
    //     background = '#2E3B55',
    // };
return (
	<AppBar position="static" style={{ background: '#FFFFFF', color: '#0288D1'}}>
		<Toolbar variant="dense">
		<Button color="inherit" sx={{ flexGrow: 1 }}>Generate Random Graph</Button>
		<Button color="inherit" sx={{ flexGrow: 1 }}>Select Algorithm</Button>
		<Button color="inherit" sx={{ flexGrow: 1 }}>Run Algorithm</Button>
		</Toolbar>
	</AppBar>
);
}
